VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Depression Learn about depression, including symptoms, risk factors, treatment options and answers to your questions. ver en español Depression (major depressive disorder) is a common and serious medical illness that negatively affects how you feel, think, act, and perceive the world. Symptoms of depression symptoms can vary from mild to severe and can appear differently in each person. These symptoms can include: Feeling sad, irritable, empty and/or hopeless. Losing interest or pleasure in activities you once enjoyed. A significant change in appetite (eating much less or more than usual) and/or weight (notable loss or gain unrelated to dieting). Sleeping too little or too much. Decreased energy or increased tiredness or fatigue. Increase in purposeless physical activity (e.g., inability to sit still, pacing, handwringing) or slowed movements and speech that are enough to be observed by others. Feeling worthless or excessively guilty.', '{-0.09096357971429825,-0.00867824163287878,0.8503925800323486,-0.25364968180656433,0.011058219708502293,0.7096988558769226,-0.38441309332847595,0.16893726587295532,0.15393419563770294,-0.478407621383667,0.24146011471748352,-0.2972292900085449,-0.2758612036705017,-0.3677760660648346,-0.40856438875198364,0.617634117603302,-0.049019429832696915,0.19996561110019684,0.203743577003479,0.21371901035308838,-0.9697019457817078,-0.6643745303153992,-0.08073481172323227,-1.0716397762298584,-0.3013630211353302,0.13919155299663544,-0.5718247890472412,-0.6250503659248352,-0.5411808490753174,0.41242721676826477,-0.5255599021911621,0.11626584082841873,0.039121173322200775,0.42884519696235657,0.05257308483123779,-0.3172397315502167,-0.3157321810722351,0.170387402176857,-0.21219591796398163,-0.5524464845657349,-0.1496587097644806,0.07246063649654388,-0.4491214156150818,0.7169720530509949,-0.737983763217926,-0.1969977766275406,0.11804555356502533,0.18779534101486206,0.9241707324981