VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'difficult to determine at what point this may occur or what circumstances, if any, may trdigger it. If a person experiences several episodes of major depression, a psychiatrist or other mental health professional may suggest long-term treatment. What kinds of treatments work for depression? A wide variety of treatments have been proven effective in treating depression. Some involve talking and behavioral change. Others involve taking medications. There are also techniques that focus on neuromodulation, which incorporates electrical, magnetic or other forms of energy to stimulate brain pathways. Examples of neuromodulation include electroconvulsive therapy (ECT), vagus-nerve stimulation (VNS), transcranial magnetic stimulation (TMS) and deep-brain stimulation (DBS). The choice of therapy should be guided by the nature and severity of depression, past responses to treatment, and the preferences of the individual in treatment.', '{-0.09894531220197678,0.3312336206436157,0.7311239242553711,-0.19615888595581055,0.19692040979862213,0.23594292998313904,-0.37956690788269043,-0.18247796595096588,0.02078801766037941,0.013079355470836163,0.3959614634513855,-0.3463963568210602,-0.5026300549507141,0.15215617418289185,0.0298245120793581,0.22842416167259216,0.6586858630180359,0.3146684169769287,-0.060710616409778595,0.40240684151649475,-0.6956599354743958,-0.33744749426841736,-0.2959253191947937,-0.876128613948822,-0.2164996862411499,0.4459330141544342,-0.4894052743911743,-0.7039459943771362,0.043604776263237,0.22624145448207855,-0.711068868637085,0.16062721610069275,0.2251162976026535,0.28851455450057983,-0.24271243810653687,-0.6953684091567993,-0.6384590268135071,0.7063817977905273,0.9273417592048645,-0.535162091255188,-0.6836010217666626,-0.3633037507534027,-0.939913809299469,0.4606706500053406,-0.6867806911468506,-0.3584160804748535,-0.04409663379192352,0.09249896556138992,0.6597194671630859,-0.10348053276