VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 4, 'rity of depression, past responses to treatment, and the preferences of the individual in treatment. What do I need to tell my doctor when discussing my feelings of depression? Total openness is important. You should talk to your healthcare professional about all of your symptoms, important milestones in your life and any history of abuse or trauma. Also tell your them about past history of depression or other emotional symptoms in yourself or family members, medical history, medications you are taking — prescribed or over-the-counter. It is also key to share how depression has affected your daily life and whether you have ever thought about suicide. How long should I wait before I go and see a medical professional? It is important to see a healthcare professional as soon as you notice significant changes in your mood, difficulties in your work/school or home life, or if those close to you have commented about any concerning changes in your mood, personality and/or behavior.', '{-0.4248735010623932,-0.26089704036712646,0.5113478899002075,-0.6883361339569092,-0.2392413318157196,0.6862913370132446,-0.2118636667728424,0.12066581845283508,-0.08293966203927994,-0.39363351464271545,0.18847379088401794,0.08015602082014084,-0.25214508175849915,0.12877286970615387,-0.3575284481048584,0.5061383247375488,0.35960862040519714,0.24201057851314545,-0.2288946509361267,0.7277150750160217,-0.08640830963850021,-0.7555636763572693,-0.37217190861701965,-0.5257625579833984,-0.058803290128707886,0.3495430052280426,-0.4058208465576172,-0.952293336391449,-0.34718403220176697,0.3613041639328003,-0.6932880878448486,0.4578143060207367,-0.04770292714238167,0.6875635385513306,-0.11392535269260406,-0.5860215425491333,-0.16236041486263275,0.21241256594657898,0.43128374218940735,-0.2678101062774658,0.13061220943927765,-0.20350833237171173,-0.5916975736618042,0.5385932326316833,-0.7244109511375427,0.07767795771360397,0.462366938