VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'a number of psychotherapeutic treatments. Treatment helps most people lead normal productive lives. There are several types of anxiety disorders: generalized anxiety disorder, panic disorder with or without agoraphobia, specific phobias, agoraphobia, social anxiety disorder, separation anxiety disorder, and selective mutism. Learn more Expert Q&A: Anxiety Disorders What''s the difference between normal anxiety and an anxiety disorder? It is normal for people to experience anxiety and have worries about different aspects of their lives. If you remember back to a time when you had a big exam or presentation, it is normal to feel nervous or on edge. The difference between normal anxiety and an anxiety disorder is when anxiety becomes persistent or recurrent, preventing you from full participation in life. Anxiety can range from relatively mild (occasional “butterflies,” jitteriness, accompanied by a sense of unease) to severe (frequent, disabling panic attacks).', '{-0.7652905583381653,-0.25368955731391907,0.2815406322479248,-0.11402367800474167,0.23514379560947418,0.12725888192653656,-0.38795050978660583,-0.02223964035511017,-0.2408444881439209,-0.7628730535507202,0.2795240879058838,0.5625481605529785,-0.1912941336631775,-0.6602291464805603,-0.3084316551685333,0.22832897305488586,0.1738966703414917,0.2209450900554657,-0.6204331517219543,0.51588374376297,-0.4834628403186798,-0.2891795337200165,-0.34980395436286926,-0.38697752356529236,0.05143541470170021,-0.2785401940345764,-0.2889266014099121,-0.3832259774208069,-0.8646613955497742,0.4069717228412628,-0.17196829617023468,0.022795910015702248,-0.16287913918495178,0.1506889909505844,-0.13067299127578735,-0.5589966773986816,-0.17234814167022705,0.719485878944397,-0.5124743580818176,0.23497088253498077,0.24098598957061768,-0.0642867311835289,-0.7545017600059509,-0.27016767859458923,0.027299251407384872,0.3799394369125366,0.30808353424072266,0.42884653