VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'These approaches can provide relief and can be used anywhere once the person understands the method. Mental health professionals can guide the person who needs a more personal approach to learning relaxation or meditation. Are there medications that can help with panic attacks? Yes. There are many medications that have FDA approval to treat anxiety disorders. For individuals who prefer medication, it is recommended to start with a selective serotonin reuptake inhibitor (SSRI). There is no evidence for any particular SSRI being better than another. This class of medications is not only helpful for panic attacks, but it’s also first-line treatment for generalized anxiety disorder, agoraphobia, and social anxiety disorder. They can be quite effective and have few side effects, although it takes a few weeks to start noticing their benefit. In the past, benzodiazepines were commonly used to provide relief from anxiety.', '{-0.6398351788520813,-0.1598517745733261,0.39438170194625854,-0.38602107763290405,0.43179893493652344,0.41751235723495483,-0.3368742763996124,-0.09857867658138275,-0.09233244508504868,-0.9045237302780151,0.46272340416908264,0.39906787872314453,-0.23095522820949554,-0.5875889658927917,-0.44969820976257324,0.3867425322532654,0.0015896386466920376,0.038223735988140106,-0.13174785673618317,0.6780962347984314,-0.7087729573249817,-0.367732971906662,-0.6342224478721619,-0.40789681673049927,-0.05969542637467384,-0.039083220064640045,-0.4136442542076111,-0.7180586457252502,-0.09254764020442963,0.6758645176887512,-0.4057745039463043,0.014952783472836018,-0.13639786839485168,0.010720423422753811,-0.3448616862297058,-1.0341126918792725,-0.5677133202552795,1.0023869276046753,0.1932937055826187,-0.08243890106678009,0.03257276117801666,0.12261885404586792,-1.124060869216919,-0.06815358996391296,-0.3505508005619049,-0.2686401903629303,-0.0036351487506181,0.06959418952465057,0.13086088001728058,0.44