VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 4, 'icing their benefit. In the past, benzodiazepines were commonly used to provide relief from anxiety. However, best practice today is to consider these medications when there’s been a partial response to an initial medication option. In these cases, a long-acting benzodiazepine is preferred. While these medications are effective, they should be used for short-term relief. They have many side effects, including drowsiness, and can be habit-forming at higher doses. People taking these medications should not use heavy machinery or drive until they understand how the medication might affect them. How are children with anxiety disorders treated? Anxiety disorders are the most common psychiatric disorders in children and adolescents. Cognitive behavioral therapy (CBT) is indicated for all of the childhood anxiety disorders. Therapy alone can be an effective treatment for mild cases.', '{-0.2559455931186676,0.3582752048969269,0.3129197061061859,-0.4647110402584076,0.3874274790287018,-0.09243222326040268,-0.7086712718009949,-0.1337575912475586,0.26763996481895447,-0.5661880373954773,0.7894278764724731,0.5735361576080322,-0.12114061415195465,-0.18876393139362335,-0.7854125499725342,0.6271088719367981,-0.250815749168396,0.34514176845550537,-0.34679681062698364,0.7171117067337036,-0.46072518825531006,-0.6702392101287842,-0.3680926561355591,-0.24120700359344482,-0.17106394469738007,0.06945541501045227,-0.1718653291463852,-0.5285605788230896,-0.2580006718635559,0.3562765419483185,0.004655394237488508,-0.15545588731765747,0.11185090243816376,-0.1021728515625,-0.00024199338804464787,-0.4952339231967926,-0.08458387106657028,1.1322176456451416,-0.11519353836774826,-0.17015492916107178,-0.14185957610607147,-0.012591198086738586,-1.0205905437469482,-0.7019179463386536,-0.6787176728248596,-0.16152572631835938,0.11232612282037735,0.1737290620803833,0.09035386145114899,-0.09729620069265366,-0.10794159770011902,-0.0258