pared to provide care when it''s needed most. Read the Reviews What You Learn What You''ll Learn What is First Aid? When you understand first aid, you''ll gain the ability to help those in need. Through our first aid certification classes you''ll learn how to respond to specific situations, which will help you care for people in crisis as they wait for medical professionals to arrive. Learn More The Science Behind The Training Behind every American Red Cross health and safety training program stands a team of experts ensuring what is taught is based on the latest and best in emergency science. Learn More How We Teach How We Teach Classroom / Skills Check Local in-person training Learn from experienced instructors Convenient locations and times for instructor led skills check Satisfies OSHA workplace safety certification requirements Online + Classroom Combines the flexibility of online training with instructor-led skills check Start taking your online portion immediately Convenient locations and times for in-person or virtual skills check with experienced instructors Satisfies OSHA workplace safety certification requirements Online Work at your own pace Engaging and Interactive courses Start taking your course immediately Course access after completion Certifications & CEUs Certifications & CEUs Certifications Made Simple The American Red Cross makes certification fast, simple and easy. With Red Cross Digital Certificates you get anytime, anywhere access to your certificates;

