VALUES ('Medicines used in the treatment of opioid dependence', 'Opioid dependence is a chronic condition that can lead to significant harm if left untreated. People who experience opioid dependence and the treatments themselves are highly stigmatised. Person-centred trauma-informed services are critical to therapeutic engagement and effectiveness. Buprenorphine and methadone are highly effective, evidence-based medicines for opioid dependence. In recent years, long-acting injectable buprenorphine has emerged as a safe and effective treatment option, offering flexible weekly or monthly dosing. The long-term treatment of opioid dependence can be undertaken in primary care settings. General practitioner and nurse practitioner prescribing, and community pharmacist dispensing, are essential for ongoing care. Australian jurisdictions have differing regulations that guide the prescribing of medicines for opioid dependence. Health professionals should be familiar with their local jurisdiction’s guidelines as well as the national guidelines. Drug and alcohol telephone services are available in each jurisdiction and can provide advice to health professionals. Opioid dependence is a chronic relapsing medical condition. According to the World Health Organization’s International Classification of Diseases 11th revision (ICD-11), the diagnosis of opioid dependence has 3 main facets: loss of control, salience, and physiological factors of neuroadaptation (tolerance and withdrawal) ( Diagnosis of opioid dependence requires 2 out of 3 of the following: People can develop opioid dependence from illicit and pharmaceutical opioids, both prescribed and non-prescribed. Opioid dependence is a stigmatised condition. The experience of stigma and discrimination adversely affects health and prevents people from disclosing behaviours and accessing or staying in treatment. Opioid dependence treatment (ODT) with long-term prescribed opioids, such as buprenorphine or methadone, is highly effective and reduces the health, social and economic harms for people experiencing opioid dependence, In Australia, nearly 75% of ODT is provided in primary care settings. Most prescribers are general practitioners (GPs) with a small but increasing number of nurse practitioners (NPs). As ODT is highly effective, many people will greatly improve and can transition to ongoing treatment in primary care. Treatment in the primary care setting reduces stigma and enables better management of people’s general health care. A core role for primary care is the long-term management of people particularly whose ODT has stabilised. Ensuring good connections and collaboration between GPs, NPs, community pharmacists and local AOD specialist settings for consultation, advice and support, which may be virtual, is essential. Planned opioid withdrawal may be suitable for people who are using low doses of opioids (i.e. oral morphine equivalent daily dose less than 60 mg) or have a short history of opioid dependence (weeks to months);

