VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'e role for primary care is the long-term management of people particularly whose ODT has stabilised. Ensuring good connections and collaboration between GPs, NPs, community pharmacists and local AOD specialist settings for consultation, advice and support, which may be virtual, is essential. Planned opioid withdrawal may be suitable for people who are using low doses of opioids (i.e. oral morphine equivalent daily dose less than 60 mg) or have a short history of opioid dependence (weeks to months);

