VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 8, 'sociated with infection and vein damage. Naltrexone is an opioid antagonist with limited use in ODT. It may be used as adjunctive therapy in the maintenance of abstinence from opioids for people with a history of opioid dependence who have fully withdrawn from opioids. It has increased overdose risk and is not subsidised on the Pharmaceutical Benefits Scheme (PBS) for opioid dependence. Oral naltrexone is more commonly used in Australia for alcohol dependence relapse prevention. Like other opioids, methadone and buprenorphine can cause sedation, light-headedness, nausea, vomiting, dry mouth, hypotension and, rarely, biliary or renal tract spasm. There is an increased risk of sedation and respiratory depression when methadone is used with other sedatives (e.g. benzodiazepines, alcohol). Buprenorphine is less sedating and is preferred if a particular risk of sedation exists.', '{0.40539753437042236,-0.06993704289197922,-0.15057796239852905,0.12235840409994125,0.10051131248474121,0.12568847835063934,-0.5230392813682556,-0.2706103026866913,0.28649452328681946,-1.0696941614151,0.4613596796989441,-0.10549375414848328,0.1726161390542984,-0.4613041579723358,-0.2643420994281769,0.4057285785675049,-0.2189614176750183,0.4677516520023346,0.4432157874107361,-0.37208980321884155,-0.7775656580924988,-0.28244057297706604,-0.15202119946479797,0.0598432719707489,-0.24215008318424225,-0.06415726989507675,-0.5047666430473328,-0.44975194334983826,0.22194938361644745,-0.36634036898612976,-0.8457639813423157,-0.07180235534906387,-0.3574562072753906,0.2518628239631653,0.21885672211647034,-0.2514150142669678,-0.23612447082996368,1.1695936918258667,-0.9380355477333069,-0.4372345209121704,-0.9645377397537231,0.4058142900466919,-0.24086274206638336,-0.45232465863227844,-0.5979053378105164,-0.48693203926086426,-0.12238568812608719,-0.2877446711063385,-0.454199880361557,0.4062953591346741,-0.14271289110183716,0.0508996024727