VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 11, 'amental approach involves significant supervision of patient progress and medication administration. In some jurisdictions, there are state-funded services that focus on people presenting with complex issues (e.g. multimorbidity, polysubstance use, unstable mental and physical health) and provide free care by multidisciplinary teams. Policies, guidelines and training requirements vary between jurisdictions. Health professionals should refer to their local jurisdiction’s guidelines and requirements for prescribing and training ( Non-trained prescribers can provide care for up to 5 people. Training must be undertaken to become endorsed to prescribe for more than 5 people. Training:  Non-trained prescribers can provide care for up to 10 people stable on methadone and start or continue treatment for up to 20 people on buprenorphine. Accredited prescribers who have undertaken training can prescribe for 200 people. Training:  Three types of prescribers: full, shared care and temporary.', '{0.09958481788635254,0.2262112945318222,-0.15171340107917786,-0.13443061709403992,0.29676535725593567,0.009410842321813107,0.221236452460289,0.09204086661338806,-0.8172341585159302,-0.7076420187950134,0.46365129947662354,-0.3308270275592804,0.2295382171869278,0.28455615043640137,-0.44511696696281433,-0.047750238329172134,-0.2365340143442154,0.5136970281600952,-0.686937689781189,0.14194528758525848,-0.5782262682914734,-0.14963923394680023,-0.5845153331756592,-0.74566251039505,0.19848127663135529,0.3426928222179413,-0.24040718376636505,-0.7357955574989319,-0.2814643383026123,0.5623672008514404,-0.9764845967292786,0.0576152503490448,0.1115729957818985,0.6035373210906982,-0.18879970908164978,-0.4115006923675537,-0.4160009026527405,0.28764602541923523,-0.8883838653564453,0.26913705468177795,-0.389692097902298,0.8748865723609924,-0.7599637508392334,-0.012816036120057106,-0.7741594314575195,-0.5597355961799622,0.2762959003