VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 13, 'setting was borne by the person in treatment. This typically costed between $120 and $210 per month. In July 2023, ODT medicines became part of the Section 100 Highly Specialised Drugs Program (Community Access) arrangements, allowing eligible people to pay the PBS co-payment for up to 28 days supply and a maximum of 5 repeats. Currently, there are no Medicare item numbers for LAIB administration for medical or nurse practitioners;

